import React from 'react';
import Grid from '@material-ui/core/Grid';
import { ActionFigureItem } from 'components/domain/displayData/cards/items/actionFigureItem';
import { VideoGameItem } from 'components/domain/displayData/cards/items/videoGameItem';
import { MovieItem } from 'components/domain/displayData/cards/items/movieItem';
import { LegoItem } from 'components/domain/displayData/cards/items/legoItem';
import { Item } from 'components/domain/displayData/cards/items/item';
import { PRODUCT_TYPE_DETAILS } from 'shared/constants/domainConstantSelectors';

const {
    ALL,
    ACTION_FIGURES,
    LEGOS,
    MOVIES,
    VEHICLES,
    VIDEO_GAMES,
} = PRODUCT_TYPE_DETAILS;

export const Cards = props => {

    const determineGridItems = () => {

        console.log(props.collectionData)

        switch(props.productType) {
        case ALL:
            return props.collectionData.map(item => (
                <Grid item xs={12} sm={6} lg={2} xl={2}>
                    <Item key={item.id} item={item} realImages={props.realImages}/>
                </Grid>));
        case ACTION_FIGURES:
            return props.collectionData.map(item => (
                <Grid item xs={12} sm={6} lg={2} xl={2}>
                    <ActionFigureItem key={item.id} item={item} realImages={props.realImages}/>
                </Grid>));
        case LEGOS:
            return props.collectionData.map(item => (
                <Grid item xs={12} sm={6} lg={2} xl={2}>
                    <LegoItem key={item.id} item={item} realImages={props.realImages}/>
                </Grid>));
        case MOVIES:
            return props.collectionData.map(item => (
                <Grid item xs={12} sm={6} lg={2} xl={2}>
                    <MovieItem key={item.id} item={item} realImages={props.realImages}/>
                </Grid>));
        case VEHICLES:
            return props.collectionData.map(item => (
                <Grid item xs={12} sm={6} lg={2} xl={2}>
                    <Item key={item.id} item={item} realImages={props.realImages}/>
                </Grid>));
        case VIDEO_GAMES:
            return props.collectionData.map(item => (
                <Grid item xs={12} sm={6} lg={2} xl={2}>
                    <VideoGameItem key={item.id} item={item} realImages={props.realImages}/>
                </Grid>));
        default: 
            return <></>;
        }
    };

    return (
        <Grid container style={{ padding: 24 }}>
            {determineGridItems()}
        </Grid>
    );
};
